\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"D4SaofKCYwo\",\"title\":\"Are Aerospikes Better Than Bell Nozzles?\",\"lengthSeconds\":\"3691\",\"keywords\":[\"Aerospike\",\"Aerospikes\",\"Aerospike rocket engine\",\"arrowspike rocket engine\",\"arrowspike\",\"arrow spike\",\"aero spike\",\"are areospike rocket engines better than traditional bell engines\",\"xrs-2200\",\"rs-2200\",\"linear aerospike\",\"j-2t engine\",\"toroidal aerospike\",\"elon musk\",\"elon musk aerospike engine\",\"spacex aerospike\",\"raptor engine\",\"raptor aerospike\",\"aerospike vs\",\"spacex raptor vs\",\"RS-25 engine\",\"venturestar\",\"x33\",\"x-33\",\"tim dodd\",\"everyday astronaut\",\"aerospike vs bell nozzle\",\"rocket\",\"future rocket\"],\"channelId\":\"UC6uKrU_WqJ1R2HMTY3LIx5Q\",\"isOwnerViewing\":false,\"shortDescription\":\"Timestamps:\\n6:20 - How Nozzles Work\\n16:00 - How Aerospikes Work\\n19:55 - The Problems With Aerospikes\\n32:50 - Comparing Aerospike Engines To Bell Engines\\n41:30 - What The Experts Say\\n51:35 - Future Aerospike Prospects\\n54:00 - Summary\\n\\nArticle version for easy reading and references - http:\/\/everydayastronaut.com\/aerospikes\\n\\nToday were going to look at the history of aerospike engines, go over how nozzles work including things like overexpansion, underexpansion and even expansion ratios, well look at the pros and cons of the aerospike, the physical limitations and problems, then well compare the aerospike to some other traditional rocket engines. \\n\\nBut thats not all, I obtained never seen before photos and videos of some aerospikes, well get opinions from some people who have actually worked with aerospike engines, look at some promising prospects and compelling concepts and by the end of the video well hopefully know whe "webCommandMetadata":{"url":"/watch?v=D4SaofKCYwo\u0026t=3240s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"D4SaofKCYwo","continuePlayback":true,"startTimeSeconds":3240}}},{"text":" - Summary\n\nArticle version for easy reading and references - "},{"text":"http://everydayastronaut.com/aerospikes","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIotC-9Z2a6QIVVazVCh2WxAxrSIrGiZSf1KbCDw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Feverydayastronaut.com%2Faerospikes\u0026event=video_description\u0026v=D4SaofKCYwo\u0026redir_token=aEWxtXt17SnGFtLp7lx2EkLHz8t8MTU4ODY4MjU3NUAxNTg4NTk2MTc1","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Feverydayastronaut.com%2Faerospikes\u0026event=video_description\u0026v=D4SaofKCYwo\u0026redir_token=aEWxtXt17SnGFtLp7lx2EkLHz8t8MTU4ODY4MjU3NUAxNTg4NTk2MTc1","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nToday were going to look at the history of aerospike engines, go over how nozzles work including things like overexpansion, underexpansion and even expansion ratios, well look at the pros and cons of the aerospike, the physical limitations and problems, then well compare the aerospike to some other traditional rocket engines. \n\nBut thats not all, I obtained never seen before photos and videos of some aerospikes, well get opinions from some people who have actually worked with aerospike engines, look at some promising prospects and compelling concepts and by the end of the video well hopefully know whether or not the holy grail of rocket engines is just waiting to be utilized or if aerospikes just simply arent worth it.\n\nSpecial thanks to @MartianDays on Twitter for the scale engine renders! - "},{"text":"https://twitter.com/martiandays","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIotC-9Z2a6QIVVazVCh2WxAxrSIrGiZSf1KbCDw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Ftwitter.com%2Fmartiandays\u0026event=video_description\u0026v=D4SaofKCYwo\u0026redir_token=aEWxtXt17SnGFtLp7lx2EkLHz8t8MTU4ODY4MjU3NUAxNTg4NTk2MTc1","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Ftwitter.com%2Fmartiandays\u0026event=video_description\u0026v=D4SaofKCYwo\u0026redir_token=aEWxtXt17SnGFtLp7lx2EkLHz8t8MTU4ODY4MjU3NUAxNTg4NTk2MTc1","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nAnd also thanks to Charlie Garcia for helping me learn so much! - "},{"text":"https://www.youtube.com/user/dragonri...","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIotC-9Z2a6QIVVazVCh2WxAxrSIrGiZSf1KbCDw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/user/dragonrider66511","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/user/dragonrider66511","nofollow":true}}},{"text":"\n\n--------------------------\n\nWant to support what I do? Consider becoming a Patreon supporter for access to exclusive livestreams, our discord channel and subreddit! - "},{"text":"http://patreon.com/everydayastronaut","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIotC-9Z2a6QIVVazVCh2WxAxrSIrGiZSf1KbCDw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fpatreon.com%2Feverydayastronaut\u0026event=video_description\u0026v=D4SaofKCYwo\u0026redir_token=aEWxtXt17SnGFtLp7lx2EkLHz8t8MTU4ODY4MjU3NUAxNTg4NTk2MTc1","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fpatreon.com%2Feverydayastronaut\u0026event=video_description\u0026v=D4SaofKCYwo\u0026redir_token=aEWxtXt17SnGFtLp7lx2EkLHz8t8MTU4ODY4MjU3NUAxNTg4NTk2MTc1","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nThanks to my Moon Walkers for helping produce each and every video! - Neurostream, Max Haot, Thomas May, Jason Padilla, Joe Leva, John Malkin, Larry D Lysinger, ArcTechInc, Blake Jacobs, Ole Mathias Heggem, Jared Smith, Mac Malkawi, Jethro, TTTA and NSS North Houston Space Society!\n\nThe best place for all your space merch nee al bell engines","xrs-2200","rs-2200","linear aerospike","j-2t engine","toroidal aerospike","elon musk","elon musk aerospike engine","spacex aerospike","raptor engine","raptor aerospike","aerospike vs","spacex raptor vs","RS-25 engine","venturestar","x33","x-33","tim dodd","everyday astronaut","aerospike vs bell nozzle","rocket","future rocket"],"channelId":"UC6uKrU_WqJ1R2HMTY3LIx5Q","isOwnerViewing":false,"shortDescription":"Timestamps:\n6:20 - How Nozzles Work\n16:00 - How Aerospikes Work\n19:55 - The Problems With Aerospikes\n32:50 - Comparing Aerospike Engines To Bell Engines\n41:30 - What The Experts Say\n51:35 - Future Aerospike Prospects\n54:00 - Summary\n\nArticle version for easy reading and references - http://everydayastronaut.com/aerospikes\n\nToday were going to look at the history of aerospike engines, go over how nozzles work including things like overexpansion, underexpansion and even expansion ratios, well look at the pros and cons of the aerospike, the physical limitations and problems, then well compare the aerospike to some other traditional rocket engines. \n\nBut thats not all, I obtained never seen before photos and videos of some aerospikes, well get opinions from some people who have actually worked with aerospike engines, look at some promising prospects and compelling concepts and by the end of the video well hopefully know whether or not the holy grail of rocket engines is just waiting to be utilized or if aerospikes just simply arent worth it.\n\nSpecial thanks to @MartianDays on Twitter for the scale engine renders! - https://twitter.com/martiandays\n\nAnd also thanks to Charlie Garcia for helping me learn so much! - https://www.youtube.com/user/dragonrider66511\n\n--------------------------\n\nWant to support what I do? Consider becoming a Patreon supporter for access to exclusive livestreams, our discord channel and subreddit! - http://patreon.com/everydayastronaut\n\nThanks to my Moon Walkers for helping produce each and every video!
